use cheers_bitboards::BitBoard;

#[derive(Copy, Clone)]
pub struct MagicSquare {
    pub index: usize,
    pub mask: BitBoard,
    pub magic: u64,
    pub shift: u8,
}

#[allow(dead_code)]
pub struct LookupTables {
    pub knight_table: [BitBoard; 64],
    pub king_table: [BitBoard; 64],
    pub pawn_push_one_tables: [[BitBoard; 64]; 2],
    pub pawn_attack_tables: [[BitBoard; 64]; 2],
    pub sliding_attack_table: [BitBoard; 107648],
    pub between: [[BitBoard; 64]; 64],
    pub rook_magics: [MagicSquare; 64],
    pub bishop_magics: [MagicSquare; 64]
}

impl LookupTables {
    pub fn bishop_attack_index(&self, square: usize, blocking_mask: BitBoard) -> usize {
        let magic_square = unsafe { self.bishop_magics.get_unchecked(square) };
        magic_square.index
            + magic_hash(
                magic_square.mask & blocking_mask,
                magic_square.magic,
                magic_square.shift,
            )
    }

    pub fn rook_attack_index(&self, square: usize, blocking_mask: BitBoard) -> usize {
        let magic_square = unsafe { self.rook_magics.get_unchecked(square) };
        magic_square.index
            + magic_hash(
                magic_square.mask & blocking_mask,
                magic_square.magic,
                magic_square.shift,
            )
    }

    pub fn print_magics(&self) {
        println!("Rook magics:");
        for square in self.rook_magics.iter() {
            println!("{:#018X},", square.magic);
        }
        println!("Bishop magics:");
        for square in self.bishop_magics.iter() {
            println!("{:#018X},", square.magic);
        }
    }
}

fn magic_hash(blocking_mask: BitBoard, magic: u64, shift: u8) -> usize {
    ((blocking_mask.as_u64().wrapping_mul(magic)) >> (64 - shift)) as usize
}

